import "./styles.css";

import Email from "./components/Email";
import Row from "./components/Row";
import Cell from "./components/Cell";
import Grid from "./components/Grid";

export default function App() {
	return (
		<div className="App">
			<Email>
				<Grid>
					<Row>
						<Cell>
							<h1>Hello</h1>
						</Cell>
						<Cell>
							<h1>World</h1>
						</Cell>
					</Row>
					<Row>
						<Cell>
							<h2>Hello</h2>
						</Cell>
					</Row>
				</Grid>
			</Email>
		</div>
	);
}
